import "./header.css"

export default function Header() {
  return (
    <>
    <div className="header">
      <ul>
      <img src="./images/pic13.png" alt=""  className="image"/>
      <a>Home</a>
      <a>About Us</a>
      <a>Course</a>
      <a>Contact Us</a>
      <button>Join Class</button>
      <button>Book A Free Trial</button>
      </ul>
 
    </div>
    </>
  );
}
